import { MdLocalPizza as icon } from 'react-icons/md';

export default {
  // Computer Name
  name: 'burger',
  // visible title
  title: 'Burgers',
  type: 'document',
  icon,
  fields: [
    {
      name: 'name',
      title: 'Burger Name',
      type: 'string',
      description: 'Name of burger',
    },
    {
      name: 'slug',
      title: 'Slug',
      type: 'slug',
      options: {
        source: 'name',
        maxLength: 100,
      },
    },
    {
      name: 'image',
      title: 'Image',
      type: 'image',
      options: {
        hotspot: true,
      },
    },
    {
      name: 'price',
      title: 'Price',
      type: 'number',
      description: 'Price of the burger in cents',
      validation: Rule => Rule.min(1000),
    },
    {
      name: 'toppings',
      title: 'Toppings',
      type: 'array',
      of: [{ type: 'reference', to: [{ type: 'topping' }] }],
      // TODO: Add custom input component
    },
  ],
  preview: {
    select: {
      title: 'name',
      media: 'image',
      topping0: 'toppings.0.name',
      topping1: 'toppings.1.name',
      topping2: 'toppings.2.name',
      topping3: 'toppings.3.name',
    },
    prepare: ({ title, media, ...toppings }) => {
      // 1. Filter undefined toppings out
      const tops = Object.values(toppings).filter(Boolean);
      // 2. return the preview object for the burger
      return {
        title,
        media,
        subtitle: tops.join(', '),
      };
    },
  },
};

